import React, { Component } from 'react';

const User = ({userName}) =>{
    const handleClick = ()=>{
        fetch('http://localhost:3000/logout')
        .then(res => res.json())
        .then(res => console.log("logged out"))
        window.location = window.location
    }
    return (
        <div>
           < button
                      onClick={()=>handleClick()} 
                      style={{
                        position:'absolute',
                        padding:'5px 10px',
                        // height:'25px',
                        lineHeight:'25px',
                        borderRadius:'3px',
                        backgroundColor:'white',
                        color:'black',
                        bottom:'5%',
                        left:'2%',

                      }}
                    >Hi! {userName}</button>
        </div>
    )
}

export default User;
